  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `quiz_user_session_id` bigint unsigned NOT NULL,
  `firstname` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `lastname` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `quiz_guest_users_quiz_user_session_id_foreign` (`quiz_user_session_id`),
  CONSTRAINT `quiz_guest_users_quiz_user_session_id_foreign` FOREIGN KEY (`quiz_user_session_id`) REFERENCES `quiz_user_sessions` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

