/*Table structure for table `quiz_statistics` */

DROP TABLE IF EXISTS `quiz_statistics`;

CREATE TABLE `quiz_statistics` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `quiz_id` bigint unsigned NOT NULL,
  `quiz_guest_user_id` bigint unsigned NOT NULL,
  `is_ended` tinyint(1) NOT NULL,
  `unanswered_count` smallint NOT NULL DEFAULT '0',
  `score` smallint NOT NULL,
  `duration_left` int NOT NULL,
  `submit_date` timestamp NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `quiz_statistics_quiz_id_foreign` (`quiz_id`),
  KEY `quiz_statistics_quiz_guest_user_id_foreign` (`quiz_guest_user_id`),
  CONSTRAINT `quiz_statistics_quiz_guest_user_id_foreign` FOREIGN KEY (`quiz_guest_user_id`) REFERENCES `quiz_guest_users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `quiz_statistics_quiz_id_foreign` FOREIGN KEY (`quiz_id`) REFERENCES `quizzes` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

